

CREATE TABLE `calendar_datetime_records` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` varchar(11) NOT NULL,
  `repeat_group` varchar(255) DEFAULT NULL,
  `relevant_phone` varchar(50) DEFAULT NULL,
  `relevant_members` varchar(255) DEFAULT NULL,
  `case_level` varchar(255) NOT NULL DEFAULT '1',
  `informant` varchar(255) DEFAULT NULL,
  `informant_type` varchar(255) DEFAULT NULL,
  `thing_remark` varchar(20) DEFAULT NULL,
  `case_title` varchar(255) DEFAULT NULL,
  `case_content` varchar(255) DEFAULT NULL,
  `case_location` varchar(255) DEFAULT NULL,
  `case_remarks` varchar(255) DEFAULT NULL,
  `case_begin` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `case_end` datetime NOT NULL DEFAULT '0000-00-00 00:00:00',
  `case_all_day` int(11) NOT NULL DEFAULT 0,
  `calendar_source` varchar(50) DEFAULT 'NULL',
  `notification_record` varchar(10) DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT current_timestamp(),
  `updated_at` timestamp NOT NULL DEFAULT current_timestamp() ON UPDATE current_timestamp(),
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3756 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;




